import React, { Component } from 'react';

class DiyList extends Component{
    render(){
        const { value } = this.props;
        return(
            <div>
                <h2>List</h2>
                {
                    (()=> {
                        if (value === 1) return (<div> motor </div>);
                        if (value === 2) return (<div> wings </div>);
                        if (value === 3) return (<div> frame </div>);
                        if (value === 4) return (<div> control board </div>);
                        if (value === 5) return (<div> esc </div>);
                        if (value === 6) return (<div> battery </div>);
                        if (value === 7) return (<div> antenna </div>);
                    })()
                }
            </div>
        );
    }
}

export default DiyList;
